package patterns.Strings;

public class _1392_RollingHash {
    public static String longestPrefix(String s) {
        String result = "";
        int index = 0;

        int len = s.length();
        int i = 0 ;
        int j = len-1;
        char[] chars = s.toCharArray();
        long mod = 1000000007;
        int prime = 31;
        long pHash = 0 ;
        long sHash = 0;
        long sPow = 1;
        while (i < len-1 && j >0){
            int pCh = chars[i]-'a';
            int sCh = chars[j]-'a';
            pHash = (pHash*prime+pCh)%mod;
            sHash = sHash + (sPow*sCh)%mod;
            sPow = (sPow*prime)%mod;
            if (sHash == pHash){
                index = i+1;
            }
            i++;
            j--;
        }
        return s.substring(0,index);
    }




    public static void main(String[] args){
        String s = "level";
        String s2 = "ababab";
        String s3 = "abcdabcdabcdabcd";
        String s1 = "";
        System.out.println(longestPrefix(s3));

    }

}
